$.um=function(){var s="We live in a country which although has come a far way ahead in terms of advancements, but still remains shackled due to caste differences in people. There is still some amount of discrimination and division about people coming from varying castes. For many of us, things like caste might seem of little consequence with respect to what a person should be entitled to. However caste discrimination still remains one of the larger problems that we as a nation need to tackle. \n\nDue to such caste differences, a lot of reservation systems have come in place, especially in the educational sector. Students coming from multiple other castes are provided with a certain amount of relaxation in terms of the marks that they need to score in order to get into the desired university or institute that they want. While in some cases this relaxation is helpful, since the students coming from rural or underdeveloped areas are not accustomed to the way that students from large cities and well off families usually study. In such cases, it is not wrong to provide a little bit of relaxation. However, this system is also misused at times. Not every caste student requires relaxation in their academics. \n\nTherefore, in this scenario, it is the general category students that are affected the most. They often have to work way harder than their peers who come from other castes but don't have any need of relaxation. This creates an unhealthy rift between such students. Plus, it also promotes unfairness to a certain degree. Unfortunately this system has been set in place and unless there is a big change or revolution, there might not be a major change in how things are heading. \n\nA more disturbing fact is that generals are only 30% of the population and rest are reserved. No matter how hard they work, they always end up getting less than what they deserve and that is quite depressing.\nMany lose their love for the country because after all it's the government who is responsible for all this chaos. Many can't stop themselves from developing negative emotions towards the reserved candidates as after all they took what they deserved even though reservation was supposed to stop this feeling.\nThere\u2019s discrimination based on petty things pretty much everywhere in the world. Reservation gives you a taste of it in the early stages of your independent life hence preparing you for all the discrimination you\u2019re gonna face in the future. It teaches you how to accept it calmly and not to make a fuss about it.\nAll in all, despite some actual needs of the reservation system, it is the general category student that suffers the most. \n\n"
return P.am(["title",["How to write a good official Resume?","Why should you do internships?","What are the best sites to apply for internships in India?","What are the upcoming careers in science field?","What is the best way to earn my pocket money online as a student?","What is my experience as a general category candidate in India?","What are the various scholarships available for MBBS students in India?","Why do so many students in India study Engineering?","What are the future careers to arise after the pandemic?","What skills should I possess in the upcoming scenario?","How will the NEP 2020 impact students?","What are some good career options in Arts? Are there any?","What are the top career myths?","Should I work for a startup or in a 9-5 corporate job?","How to start my own startup?","Which is the best board for me?"],"image",["assets/Images/blog images/1.jpg","assets/Images/blog images/2.jpg","assets/Images/blog images/3.png","assets/Images/blog images/4.jpeg","assets/Images/blog images/5a.png","assets/Images/blog images/6.jpg","assets/Images/blog images/7.jpg","assets/Images/blog images/8.jpg","assets/Images/blog images/9.jpeg","assets/Images/blog images/10.jpg","assets/Images/blog images/11.jpg","assets/Images/blog images/12.png","assets/Images/blog images/13.jpg","assets/Images/blog images/14.jpg","assets/Images/blog images/15.jpeg","assets/Images/blog images/16.jpg"],"body",["Building and maintaining a good resume is extremely crucial for any working professional in today\u2019s era. A good resume will highlight your skills and accomplishments in a concise manner to your employer and can increase your chances of getting hired. The content, layout and design of a well made resume can put one far ahead of someone who hasn't spent the same amount of time and effort in creating a resume. There may be a big difference in opportunities, salaries and growth depending on how well your resume has been crafted.\n\nIdeally, a prospective employer will not spend more than a couple of seconds looking at your resume, hence you need to make sure that you include the most relevant and striking information that will leave a strong impression. One good practice that you can follow is the 6-60-6 rule. According to this rule, your resume should be so concise, that an employer can get a brief idea about your education, accomplishments and skills in 6 seconds itself. This is what the first 6 stands for. After this, if the employer tries to spend 60 minutes studying your resume, they should be able to know everything about your education, skills and experience that you have gathered. This is what the 60 stands for. Beyond this, the last 6 means that if an employer decides to spend 6 hours going through your resume, they shouldn\u2019t find any error and discrepancy. Therefore you should aim to make your resume completely perfect and free from any sort of errors. \n\nBeyond this, there are a few points that you need to keep in mind while building your resume. These are-\n\u25cf\tKeep your resume concise and up to the point. Make sure there are no errors. Limit your resume to a maximum of two pages. \n\u25cf\tInclude your contact information clearly. Don\u2019t include unnecessary personal information.\n\u25cf\tMention your education, degrees and courses according to the position that you are applying for. Don\u2019t mention an unnecessarily long list of courses which might not be relevant to the field. \n\u25cf\tHighlight your accomplishments and work experience. Put up anything that you feel is relevant to the field that you are applying into. This will increase your chances of getting hired.\n\u25cf\tKeep your language simple and crisp. Try to sound persuasive. \n\u25cf\tBe honest. Don\u2019t make stuff up in your resume. If your employer finds out that you have lied about something, it won't leave a good impression at all. \n\u25cf\tInclude any sort of unpaid or voluntary work that you might have done. Things like these show that you are dedicated.\n\u25cf\tPersonal points like hobbies or interests should be avoided.\n\u25cf\tIf you are a fresher who is looking for a job, you might not have any work experience to mention. In this case, highlight your projects, research work, extra activities and so on. \n\u25cf\tUse a neat format that is easy to read and looks good to the employer\n\nIt is worth taking the time to build a good resume. It can be a defining factor for the kind of job that you get. It also leaves an impression upon your employer and shows the quality of work that you can offer. \n\n\n","Internships are defined as \u201cAny official or formal program to provide practical experience for beginners in an occupation or profession\u201d\n\nWhether you are still in high school, or you are about to complete your master\u2019s program, doing an internship brings great values to your life. It is an indicator that you are willing to go out of our comfort zone to develop yourself. It shows that you are dedicated and willing to handle multiple things at once.\n\nOur economy is changing constantly and with it, the talents, skills, and experience needed to be a part of that growth cycle are too. The job market is a competitive one, and often that is a tough learning curve for recent graduates. This is a big reason behind the growth of applied learning and internship opportunities becoming a key part of the college experience for all students. The most important element of internships is that they integrate classroom knowledge and theory with practical application and skills developed in the professional world. They also bring a lot of benefits to students, both while pursuing their education and when seeking a career path post-graduation.\n\nThere are multiple advantages of doing internships. Few of the major ones are listed below. \n\u25cf\tYou get an opportunity to learn outside the classroom. You develop real life working experience, and no classroom course can substitute that. Experience will become your best teacher.\n\u25cf\tIt gives you an advantage when you apply for a proper job. It adds value to your skillset and subsequently improves your resume. This can give you an upper hand while you apply for placements. \n\u25cf\tYou get to interact with new people. Building a strong network is very important in any person\u2019s life\n\u25cf\tYou learn how to work and be responsible as a professional. You understand the way work is carried out. Hence your communication, problem solving and analytical skills improve\n\u25cf\tYou can get a mentor and receive feedback on how you are performing. This helps you to constantly strive to do better. You learn to become a better version of yourself. \n\u25cf\tYou learn from your mistakes. An internship is a good start to realise your working potential and what sort of hurdles that you might face. This helps you to prepare better for what's to come in the future.\n\u25cf\tYou learn from others. You might have the opportunity to work in a team. This builds your team management skill. You learn how to divide responsibilities and take ownership of them. You can observe what mistakes others have made so that you don't end up making them yourself. \n\u25cf\tYou discover your interest. An internship is a good platform to figure out the kind of work that you like. For instance, if you are not enjoying the work as an intern, you'll probably avoid a job in the same line. This helps you to narrow down your interests and find out what is best for you.\nThese are few of the major reasons that you should definitely opt for an internship if it's available. It's a great learning experience and it gives you taste of how professionals work in the real world. \n","Internships are a great tool in the life of any student or fresher to get work experience and develop the habit of professionalism. Working as an intern provides you with a learning experience that cannot be taught in a classroom. You learn to handle multiple things at once while developing your skill set. Your communication, teamwork, knowledge all goes up a level further. \n\nHere are some websites that you should check out to find out the best internship for you-\n\n\u25cf\tInternshala: This is one of the best resources for Indian students looking for internships. Apart from a lot of intern opportunities, the key things that differentiate this website from others are Internshala EDGE which is a review of your CV, and Internconnect, which will help interns to find interns in their company or city.\n\u25cf\tTwenty19: A very popular website for students searching for Internships. Along with internships, this site features Events happening around the country. Another very useful feature is Courses, where students can buy courses and learn online. Currently, the site features Java, Android and Professional Email writing courses.\n\u25cf\tLetsintern: Find internship jobs and 2015 summer internships in India on Letsintern . Apply for the best internships in IT, marketing, finance and more from top companies.\n\u25cf\tHelloIntern: Find the best internship programs for students and talented interns for companies. Perfect platform to look for global internship programs for a better career.\n\u25cf\tTopTalent: TopTalent.in is an exclusive online community of top notch jobs and prescreened professionals.TopTalent.in helps students and alumni of elite colleges find\n\u25cf\tFreshersWorld: Find & Apply for the Job vacancies in Government sector.The No.1 Job site for Freshers in India - IT, Software, Government , Technical, Banking & Finance.\n\u25cf\tGlassdoor: Glassdoor provides options for both jobs and internships. People have the option of (privately) posting their designation and salaries on the portal, which can help you compare your offer with that of others.\n\u25cf\tAngellist: This is among the best startup networks you will find online. If you are aspiring to intern with a startup - this is a good option. A lot of startups keep coming up with multiple openings in different fields. Create a profile, and then you can pick what you like.\n\u25cf\tStudentcompetitions: This is an awesome website, which features all the competitions going on around the world. The competitions can be searched by a variety of filters. A very useful feature of this website is the Awards CV, which collects all your competition results at one place making the student a well-deserving intern or employee.\n\u25cf\tstuMagz: If you are a student, fresher or an alumni looking for any career opportunities, right from internships to full time employment, then the Opportunities wing of stuMagz is for you. You find multiple opportunities and can apply for desired one from all the types of tech and non tech opportunities.\n\u25cf\tOther than these websites, you can try to participate in hackathons, case study and business competitions, innovation challenges and so on. Chances are, by performing well in such competitions, you will get noticed by the judges and organizers and they might approach you with internship opportunities. \n\n\n\n","Science has been impacting our lives majorly for the past few centuries and it will continue to do so for centuries to come. We have come from completely simple ages to advanced times due to various discoveries, inventions and contributions. The future holds a lot for us, it\u2019s up to us to decide how we want to shape it.\n\nThe following are some emerging fields in science that you should look out for if you are attracted to science and technology-\n\n1)\tEthical Hacking and Cyber Security\nWith businesses going digital, they are more vulnerable than ever before to cybersecurity threats. Hence, Ethical Hacking, no doubt, is one of the most demanding professions of today\u2019s world. An Ethical Hacker is a computer and network expert who attempts to penetrate a company\u2019s security system to identify weaknesses in it. They are crucial in helping companies improve their Internet security.\n\n2)\tRobotics\nAutomation is going to be one of the major changes in the coming future. We might have self cooking robots, self driving cars, automated construction and a lot more. We need robotics for all of this. There might come an age where we will share this earth with robots which occupy half of the entire population. Robots are necessary for any sort of automation and advancements. We already use them in factories, now they are coming all around us\n\n3)\tAerospace\nRanging from Aeronautics (dealing with aeroplanes) to Astronautics (dealing with space vehicles), as a professional in this field, you\u2019ll be responsible for different aspects such as the design, technical, electrical and software aspects for building missiles, aircraft, space shuttles, rockets and other aerospace machines.\nThe Indian aerospace industry is now one of the fastest growing industries in the world. Recent developments by Indian Space Research Organization (ISRO), Defence Research and Development Organization (DRDO), Hindustan Aeronautics Limited (HAL) and other private companies are promising a prosperous future of Aerospace.\n\n4)\tFood and Agriculture Science\nContrary to popular notions, the field of food and agriculture is not about ploughing fields or farming but is a technologically advanced field with cutting-edge research and constant innovations. Agricultural Biotechnology, Horticulture, Dairy Technology, Agronomy, Food Technology, Pisciculture are a few of the avenues you can look towards to build your career in this fast-growing domain.\n\n5)\tBioengineering and Biomedical Engineering\nBioengineering, one of the youngest engineering disciplines, employs the principles and tools of engineering to solve problems in biology, medicine, healthcare and related fields. Artificial organs, computer simulation for surgery, tissue engineering, medical imaging (such as MRI and CAT scan), engineered microorganisms, biomaterials and even wearable technology (such as fitness tracking bands) are all examples of Bioengineering in the real world.\nThe industry is brimming with opportunities and innovation, and allows professionals to experiment and develop cutting-edge medical solutions.\n6)\tArtificial Intelligence and Machine Learning\nFrom Google Search to Netflix to Uber, each of the applications you encounter daily utilise artificial intelligence and machine learning to make faster, effective and more personal technologies. In a Gartner report, artificial intelligence (AI) was predicted to create over 2.3 million job opportunities by 2020. Thus, this field is one of the fastest emerging in the domain of science and technology.\n\n\n\n","A lot of students in India want to learn how to make money parallel to their college studies. Due to sheer talent in the country and a huge amount of requirements in India and even in foreign countries, there is a large opportunity lying in front of you as a student. You can make decent money working as a freelancer if you have at least one marketable skill. \n\nHere we are going to mention a few methods through which you can earn money online-\n\n1)\tBlogging\nBlogging is the practice of writing articles, tutorials, or basically anything on the internet that is worth sharing. This is one of the easiest methods to earn money. It may be a slow process in the beginning but as your blog acquires a greater audience, you can not only earn a great revenue via ads but also establish yourself on the online platform. Your blog can become your online identity. It is relatively simple to set up your own blog using various websites. Some might offer free services while others might be paid. \n\n2)\tGraphic Designing\nIf you are good at art, you can enter into the realm of graphic designing and work as a freelancer by making designs for clients. Using Adobe PhotoShop, Illustrator and various other tools, you can create amazing designs that can earn you a good deal of money. You can also try to do video editing for upcoming content creators or filmmakers\n\n3)\tYoutube\nIf you feel that you have enough persistence and creativity, you can try your hand at making Youtube videos. You can establish a great online presence as well. Youtube pays you for the amount of watchtime that you get as well as by the ads. \n\n4)\tTeaching\nYou can self your own course online through various learning platforms. If you feel that you can teach people to play the piano, then go ahead and make a course on it. Or you can also take personal or group classes for people who would like to learn. You could try to get into a teaching assistant program at some coaching class. This also builds your overall communication skills\n\n5)\tDigital Marketing\nYou can offer to handle some startup\u2019s social media platforms and manage them. You can learn how to grow an online presence and get customers through that. This is a good option if someone you know is in some sort of business and would require social media marketing. \n\n6)\tSurveys\nThere are tons of opportunities on the internet where you can find websites that will pay you to take up surveys.\nThe process of getting involved with surveys is extremely simple and will earn you a few extra bucks.\n\n",s,s,"Scholarships are a great boon for students who work hard in their academic career and for those who come from humble backgrounds. There are government schemes as well as various scholarship tests and offers from other organisations which select those students who require aid and provide it to them in the form of scholarships. These scholarships can be life altering because it can help a person to study to get a job which helps them to support their lives and families. \nThe following are a couple of scholarships that are available to students who are pursuing an MBBS degree-\n 1. MOMA Scholarships - Merit cum means based scholarship for MBBS students\nThe Ministry of Minority Affairs, Govt. of India offers this scholarship to the MBBS students. Scholarships are given to the students belonging to the national Minority Community that is Muslims, Sikhs, Christians, Buddhists, Zoroastrians, Parsis & Jains. The scholarship is also known by the name merit cum means scholarship and more than 20,000 scholarships are given every year.\nThe scholarship is offered to the students who are enrolled in Medical colleges in India and whose annual family income does not exceed Rs. 2.5 Lacs. Students are paid Rs.10,000 per year (Rs. 5000 for day scholars) + Course Fee. Full course fees would be compensated for the students studying in selected Medical Institutions.\nCourses Supported by the MOMA scholarship are (1) MBBS (2) Bachelor of Ayurvedic Medicine & Surgery (BAMS) (3) Bachelor of Unani Medicine & Surgery (BUMS) (4) Bachelor of Homeopathic Medicine & Surgery) (5) Post Graduate courses (6) Bachelor of Physical Therapy (BPT) (7) Master of Physical Therapy (MPT) (8) Bachelor of Occupational Therapy (BOT) (9) Master of Occupational Therapy (MOT) (10) B.Sc. Nursing (11) M.Sc. Nursing (12) B.D.S. (13) M.D.S.\n2.Central Sector Scholarship Scheme for College & University Students\nMHRD Offers 82000 scholarships (41,000 each for boys and girls). The students who have taken admission in the first year of UG courses in Indian universities are eligible for the scholarship.\nThe selected Medical students are paid Rs.1000 per month for 3 years and Rs. 2,000 per month in the 4th year provided that the annual income of the family does not exceed Rs. 6 Lacs.\n3. North South Foundation Scholarship\nThe scholarship for engineering students is given by North South Foundation. The Scholarship is given to students pursuing professional courses like Engineering, Medical etc.The scholarship would be given for the entire course subject to the performance of the students.\nThe selected Medical students would be given a scholarship in the range of Rs. 5,000-15,000 per year given that the annual income of the family does not exceed Rs. 65,000\n4. ONGC Scholarship for SC/ST Students\nThis scholarship is provided by ONGC for SC/ST students who are pursuing professional courses like Engineering or MBBS. Out of 500 scholarships, 247 will be provided to the students pursuing Engineering and the remaining are offered to MBBS Students. The selected students will be given Rs. 4,000 per month for 4 years and the scholarship is subject to renewal every year.\nTo avail this scholarship the annual family income of the students should not exceed Rs. 4.5 Lacs per annum\n5. LIC Scholarship\nThe scholarship is provided by LIC and is applicable for students who are pursuing graduation in any stream from a Govt./ Private college. The selected students are provided Rs. 10,000 annually to pursue higher education provided the family income does not exceed Rs. 1 Lac. The scholarship is provided for the entire duration of the course.\n6. NTPC Scholarship (Only for SC/ST & PH Candidates)\nThe scholarship programme is for SC, ST & PH students who are studying at Govt. Medical Colleges in India. and have completed their first year at the respective college. The scholarship amount is Rs. 4000 per month.\n7. Swiss Government Excellence Research Scholarship\nThe scholarship is provided by Swiss Government and is applicable for students, young Medical Doctors and highly qualified postgraduate researchers from all academic fields. The selected students are provided 1920 Swiss Francs monthly along with Tuition Fee, Medical Insurance, Airfare, Housing Allowance, Transport card and other benefits.\n\n","After India gained independence, engineering became a highly demanded, yet respected course. A significant portion of the rising middle class comprised of engineers. As India moved towards the 80s, this rising middle class started to have greater say in running the affairs of the country. In addition, this middle class also laid stress on education, with engineering being a clear favourite. The future of an engineer was bright unlike many other courses such as Arts and Commerce. There was good remuneration and thus, more financial stability in pursuing engineering. In a country where more than half the population was poor, this was an attractive option to earn better remuneration and have a better life.\n\nHowever, in the current scenario, many students in their school life don't know what exactly they want to do. They do not explore or seek new opportunities. All they do is what is asked of them (and sometimes forced) by their parents, relatives or friends. They listen to the suggestions of their teachers and end up choosing a path that seems the most attractive at the moment. \n\nThe most popular path chosen by students is engineering. There are multiple reasons to why this happens-\n\n\u25cf\tLack of counselling\nMajority of schools in India do not provide an option of career counselling (which is a must for students in high schools). The only way students come to know about different jobs and career options are through their family members (and well most of them are again Engineers or in Medical professions). Their minds are influenced and attracted to the high packages and large scope of jobs without understanding the competition to get there. \n\n\n\u25cf\tFamily Pressure\nThe normal Indian family want their children to make safe decisions. If there is a choice between becoming a Pilot and earning a huge salary but with a risk of failing to become a pilot and becoming an average engineer and living a very average life with a modest salary, they would want him to choose the latter because with that his future is secured. The students are never given a chance to develop their passions or follow their hearts. \n\n\u25cf\tColleges\nThere has been a boom in the number of colleges in the country. Especially with the establishment of Indian Institutes of Technology (IITs). This led to a race for students to secure a seat in some of the elite colleges of the country. Students often end up choosing a subject that they don\u2019t necessarily like just because it has a college tag associated with it. \nAn engineering degree also gives the flexibility of changing career paths after graduation. Due to their logical mindset and application-based approach in problem-solving, engineers are found in almost every profession.\n \nThe graph shows that the growth in intake of students for engineering courses increased after 1991, and has been especially steep since 2000. The number of IITs in India has grown to 16 and the number of NITs has grown to 30 now. As of 2006, there were 1478 private colleges in India.\n\nIn conclusion, there are multiple reasons for the massive uptake of engineering admissions in the country. This trend may change, however, as people start to explore more careers and developing a greater interest in other fields. Career counselling will also play a good role in this process. \n","There is much talk currently about the future of work following the COVID-19 pandemic with a predicted global recession and period of economic turmoil. Working remotely, the digital economy, gig workers\u2019 rights and virtual offices are inevitably going to feature more in everyone\u2019s life, but which are the sectors that will want to invest in human capital this year, next year and beyond? Where will the opportunities be? What skills will they require, and how can you prepare for the new areas of demand?\n\nIt has been painful to watch the travel, tourism, hospitality and retailing sectors collapsing during the first weeks of the pandemic, but as the first casualties, they may also be the first to recover in a post-pandemic world, where people are desperate for a return to a more normal life.\n\nThese are some sectors where new careers can arise-\nHealth Sector-Public sector roles, not just nurses and clinicians, but pharmacists, carers, health trust managers and professional service roles including procurement, finance, demand management, recruitment. Digital health analysts including data scientists and infection tracing specialists. Scientists and Researchers, including virologists and microbiologists \u2013 in research and academic institutions, private laboratories, and pharmaceutical companies\n\nSupply and Demand Sector-\nSupply chain roles include planners, analysts and technology specialists who can connect hitherto unconnected parts of the supply chain to provide a responsive, slick operation that can be dialled up or down depending on demand. Logistics roles cover fulfilment, warehousing, transport and delivery management.  We are very reliant on the ability of organisations to transport goods from source to customer, and how they must need the very best distribution, productivity and data managers and analysts to be successful. Amazon recently announced they would be recruiting an additional 100,000 staff to deal with the upsurge in demand, signalling a huge need for these skills.\n\nPolitics and Government-\nDisaster and crisis response roles including the mobilisation and implementation of specialist teams in a world where speed is critical and indecision is the precursor to catastrophe. Government advisors to solve the economic and health challenges with labour market policies to meet the demand for new products and service that will require new jobs, new skills and new approaches to education.\n\nManufacturing Sector-\nTo create more national resilience there may well be a renewed focus on local production capability for everything now viewed as essential, from Food and Drink to Pharmaceuticals. Energy and especially renewable or green business roles may emerge to capitalise on the evidence of how the environment has benefitted from a reduction in pollutants caused by  \u201cpre-pandemic living\u201d.  Meanwhile \u201csocial distancing\u201d and \u201cself-isolation\u201d, as new words in our vocabulary, have forced everyone to think about the need to be less dependent on others. This has led to a renewed interest in a more self-sustaining approach to the way we live our lives. \n\nEducation Sector-\nThere has been a rapid transformation in the way learning and assessment takes place with schools, universities and education establishments, responding with breakneck speed to the demand for distance learning, for collaborative educational tools, and for qualification verification following months or years of study. This appears to be working well and may provide the impetus for a different approach to education, which will, in turn, require a new set of skills for teachers and new roles for those providing the learning infrastructure.\n\nFinancial Services Sector-\nEconomists will be in great demand to provide direction to government, to banks, to research institutes and to business, as nations seek to resurrect their economies. In banking and finance, there will be many problems to solve but there is also likely to be a more conservative approach to large graduate intake programmes.\n\nTechnology Sector-\nWithout technology, organisations and individuals would have struggled to survive the social separation that COVID-19 necessitated. In the future, the collaboration tools, communication, entertainment, information, data and the multitude of other services provided by technology are going to become even more important to the way society and the economy develops. Careers in technology will likely boom in response.\n","As most of us are in lockdown at home, we are left to wonder what a post-coronavirus-world might look like. There\u2019s a lot unknown about how the world will transform after we get the novel coronavirus under control, but it is extremely unlikely that things will just go back to exactly the way they were before. Our workplaces are likely to change, and with it, the skills companies will require. Here are a few skills that are likely to be in high demand in a post-coronavirus world.\n\n\u25cf\tThe ways companies operate and work are going to change. The world was already changing rapidly, but the pandemic accelerated it. There will be few \u201cjobs for life.\u201d Someone that is going to succeed in a post-coronavirus-world will need to be able to adapt to ever-evolving workplaces and have the ability to continuously update and refresh their skills.\n\u25cf\tOne of the best ways to prepare yourself for a post-coronavirus-world is to acquire technology skills. The reality is that technologies such as artificial intelligence, big data, the Internet of Things, virtual and augmented reality, and robotics will make businesses more resilient to future pandemics, and anyone that can help companies exploit these technologies will be in a great position.\n\u25cf\tBusinesses that have been able to come up with ways to deliver services virtually or quickly shift to new products have been able to better weather the storm. In a post-coronavirus world, we will need human ingenuity to invent, dream up new products and ways of working. Human creativity is going to be essential.\n\u25cf\tData is a critical asset for every company. With the right data, companies are able to better predict the impact of future business disruptions and are better able to serve customers with the right products and services during or after any pandemic.\n\u25cf\tAnother skill that will be essential as our global economy rebuilds from the damage done by COVID-19 is critical thinking. During the pandemic, we have seen a spike in fake news and misrepresentations of data and studies, as leaders, businesses, and governments are trying to shift blame and divert attention and proper scrutiny. People who can objectively evaluate information from diverse sources to determine what is credible will be valued.\n\u25cf\tProfessionals with digital skills, including coding, web development, and digital marketing, will become even more important than they are now. People who can keep the digital business running and thriving during economic downturns or pandemics that make in-person business impossible or less efficient are going to be on the must-hire list. \n\u25cf\tProfessionals with strong skills in leadership, including how to bring out the best and inspire teams as well as encourage collaboration, will be in demand. One of the changes in a world that are heavily augmented by the support of machines and where social distancing and home working might continue for the foreseeable future, is that more people at all levels of an organization will be in a position where they lead others. \n\u25cf\tClosely linked to leadership is another skill that is even more important in uncertain and challenging times: Emotional Intelligence (EQ). The ability to be aware of, express, and control our emotions and be aware of others' emotions is what emotional intelligence is all about. Individuals with strong EQ will be coveted by organizations of all sizes and in all industries.\n\u25cf\tThere\u2019s only one way to remain relevant in a post-coronavirus reality: commit to a lifetime of learning. The good news is that improving your skills has never been easier. Today, it doesn\u2019t require years of study or hefty loans to build up your skillset to be prepared for a post-coronavirus world. There are endless free and open online courses (MOOCs) available that will help you improve your skills.\n",'The current year has many reformations; it is no wonder that India is opening up the education sector for private investment. The move will undeniably reduce the education cost.\n\nThe NEP 2020 (New Educational Policy) is both timely and progressive. It marks a historical development in the education system of India. It focuses on universalizing access from early childhood to higher education. The NEP 2020 integrates over two out-of-school crore children and makes an effort towards socio-economically disadvantaged groups. \n\nThe NEP 2020 will deliver early childhood care and education via erasing convention workflows and a new curriculum. The new educational policy also consists of pay-and-activity-based teaching and will reinforce the most critical aspects of learning \n\nThe new education policy is taking a cluster-based approach. It includes developing school complexes, competencies assessment, National Testing Agency for universal entrance exams, and the integration of technology. These new education policy measures will go a long way to bring the desired improvement in the school education of India. \nThe NEP 2020 provides students ample opportunity to hone their skills and interests since there are provisions of multiple entry and exit in higher education. The new education policy has also dismantled the rigid differences between curricular and co-curricular subjects in school.\n\n21st-century classroom requires 21st-century teachers. The NEP attaches respect to the teaching profession. Professional development of teachers, building their accountability through tenure track system and periodic performance appraisal, all can create a positive impact. The dismantling of a rigid distinction between curricular, extracurricular and co-curricular subjects in school, and the provision of multiple entries and exit options in higher education gives flexibility to students to hone their skills and interests.\n\nAlso, the proposal to introduce vocational education from grade 6 onwards and the creation of a National Committee for the Integration of Vocational Education (NCIVE) will not only minimise the social stigma attached with taking up a vocation as a career but will also expose them to multiple career paths, including entrepreneurship.\n\n\u25cf\tThe mother tongue or local or regional language is to be the medium of instruction in all schools up to Class 5 (preferably till Class 8 and beyond), according to the policy. Under the NEP 2020, Sanskrit will be offered at all levels and foreign languages from the secondary school level. However, the policy also says "no language will be imposed on any student".\n\u25cf\tThe 10+2 structure has been replaced with 5+3+3+4, consisting of 12 years of school and three of Anganwadi or pre-school. This will be split as follows: a foundational stage (ages three and eight), three years of pre-primary (ages eight to 11), a preparatory stage (ages 11 to 14) and a secondary stage (ages 14 to 18). According to the government, the revised structure will "bring hitherto uncovered age group of three to six years, recognised globally as a crucial stage for the development of mental faculties, under school curriculum".\n\u25cf\tInstead of exams being held every year, school students will sit only for three - at Classes 3, 5 and 8. Assessment in other years will shift to a "regular and formative" style that is more "competency-based, promotes learning and development and tests higher-order skills, such as analysis, critical thinking and conceptual clarity".\n\u25cf\tBoard exams will continue to be held for Classes 10 and 12 but even these will be re-designed with "holistic development" as the aim. Standards for this will be established by a new national assessment centre - PARAKH (Performance Assessment, Review, and Analysis of Knowledge for Holistic Development).\n\u25cf\tThe policy, the government has said, aims at reducing the curriculum load of students and allowing them to become more "multi-disciplinary" and "multi-lingual". There will be no rigid separation between arts and sciences, between curricular and extra-curricular activities and between vocational and academic stream, the government said.\n\u25cf\tTo that end, the policy also proposes that higher education institutions like the IITs (Indian Institute of Technology) move towards "holistic education" by 2040 with greater inclusion of arts and humanities subjects for students studying science subjects, and vice versa.\n\u25cf\tThe NEP 2020 proposes a four-year undergraduate programme with multiple exit options to give students flexibility. A multi-disciplinary bachelor\'s degree will be awarded after completing four years of study. Students exiting after two years will get a diploma and those leaving after 12 months will have studied a vocational/professional course. MPhil (Master of Philosophy) courses are to be discontinued.\n\u25cf\tA Higher Education Council of India (HECI) will be set up to regulate higher education; the focus will be on institutions that have 3,000 or more students.\n',"In recent years, there has been a constant rise in the number of students opting for Arts after 10th. The myth that this stream is only for students who don\u2019t make proper plans is thankfully debunked. With careers in hospitality and service sectors on the rise, students are opting out of traditionally prestigious careers like Medicine and Engineering and choosing to venture into a field that they genuinely like.\n\n\u25cf\tLaw\nA commonly pursued field after opting for Arts till grade 12is law. Although a very challenging and competitive field with very few seats in the best institutions, pursuing a career in law ensures high profile jobs with excellent pay. To get admission in reputed law colleges, students must get above 60% on their grade 12 board exams, and also get a phenomenal score in their CLAT exams. Getting admitted into the best Law colleges is no easy feat, but absolutely worth the hard work. Most students choose the BA + LLB course for 5 years.\n\u25cf\tHotel/event management\nTwo incredibly job-oriented fields, students with a good temperament and knack for organisational skills will opt for this course. For this, you will have to do your bachelors in hotel/event management where, based on your skill and the college you complete the course from, you will be given a job. The hospitality industry is one that never runs out of jobs. Additionally, you may choose to do your MBA after this course and even start a hospitality business of your own.\n\u25cf\tBA + MA\nThe most commonly opted course after grade 12Arts is the BA course. The course duration is 3 years. You can choose from a very wide range of subjects to do your BA in, from Psychology, English Literature and History to Yoga, Agriculture, and French Literature. The list is endless. Truthfully, in today\u2019s economy with all its competition, doing just a BA is almost always not enough to land you a well-paying job, at least in India. You must have a plan of sorts after graduating or continue your education by pursuing a Master\u2019s degree or an MBA. More often than not, students end up choosing a career which is in no way related to their BA degree, or for that matter even their Masters, so choose carefully \u2013 but don\u2019t worry too much about it.\n\u25cf\tTourism\nIf travelling and sightseeing is your passion, then a career in tourism may just be the one for you. Although admittedly not a very lucrative field at first, it gets better with the more experience you gain. Many entrepreneurs start their own firms for travel and lodging, while others conduct guided tours. Tourism involves travel and glamour, but equal amounts of hard work and dedication.\n\u25cf\tBBA + MBA\nIf business and entrepreneurship is your forte, then choosing to major in BBA might be a good option for you. But you should know that a BBA degree by itself doesn\u2019t hold much value, so most people choose to follow up with an MBA. Keep in mind that pursuing your MBA can be done after any degree and BBA is not a prerequisite for MBA.\n\u25cf\tAdvertising\nCreativity is of utmost importance for a career in advertising. When it comes to getting a job, your portfolio plays a greater role than your degree. To get into advertising, you don\u2019t need a specific degree, but most people enter the field through a BMM or a BFA degree.\n\u25cf\tJournalism or Media\nAnother highly sought after field, you can enter into journalism or media by pursuing a Bachelor\u2019s degree in media and communication. Like advertising, your portfolio, experience and skills are more important than your degree. You can also enter into journalism through BMM. For a career in journalism, you must be willing to travel long distances, be comfortable speaking to strangers and be assertive.\n\n","In this modern world that we live in, the work culture has developed and evolved a lot. There are a lot of habits and practices that have come in place. Along with this, a couple of myths have also crept in. Myths that worked for many years but are increasingly out of touch with reality or at best, limit people\u2019s options and imagination for what they might do with their lives.  \n\n\u25cf\t\u201cOnce I land my dream job, I\u2019ll be happy\u201d\nEarly in one\u2019s career, when a clear \u201cpath\u201d seems to be available for the taking, it is easy to believe that there is a certain point one reaches in which you\u2019d finally be happy. But this is rarely what happens to most people. You adjust. Research shows that we compare up.  We look to the people that have more than us.  The better job, more stuff or more money. This makes us feel less about ourselves and gives us the sense that we never have enough. Finding a \u201cdream job\u201d or targeting a certain salary is the wrong question.  Instead, think about asking \u201cwhich one of these opportunities is going to help me be the type of person I want to be?\u201d\n\n\u25cf\t\u201cI just need to find my passion\u201d\nMorten Hansen, the author of Great at Work studied 5,000 employees of a company and found that people with high purpose and passion were the highest performing employees. Instead of trusting your gut on what interests you up, speak to your friends, former colleagues, or even a former professor with the question, \u201cWhen is a time you\u2019ve observed me at my best?\u201d  This is often a powerful activity to help you see your best self in other people\u2019s eyes.\n\n\u25cf\t\u201cYou need to have a steady income\u201d\nWhen many people talk about doing something outside the scope of full-time employment we often get to the moment where they say something along the lines of, \u201cit would be nice, but I like the comfort of having a steady job.\u201d A steady income or career would be fantastic if it didn\u2019t come with a price.  To have a steady path it often requires reinvention, reflection, network building and self-promotion to always be in a position to go after new opportunities or jobs. The belief that your task is to secure stable employment can also present a challenge when one faces and inevitable crisis at work.  For many, losing their job is a deeply shameful experience that can be immobilizing and lead to depression.\n\n\u25cf\t\u201cI will enjoy after I retire\u201d\nMany people are struggling and admit that they really would love to take a break.  Yet what holds people back is the fear they won\u2019t be \u201chireable\u201d afterwards. This may be true if you spent a year doing nothing, but most people find that instead of idleness, they are filled with active energy, doing things like volunteering in their community, spending time with loved ones, writing books or even taking an entirely new path altogether. Make a list of the twenty experiences you want to have over the next ten years.  Which ones can you take action on over the next year? How could you design extended breaks to experience some of these things sooner, rather than later?\n\n\u25cf\t\u201cTake risks only when young\u201d\nThere is never a right or the perfect time to start on a new venture or take a life-changing. You are never too old or never too young. Family will not hold you back. Time will not hold you back. Take risks and you never know what great results it might bring. \n","For the upcoming working professional, one of the most important questions is whether a startup or corporate job is better for a career in the long run. To be honest, there is no straight-forward answer to this. It all depends on your perspectives, priorities, and aspirations. Large companies have set hours, but startups are more flexible. \n\nBut what\u2019s not talked about quite as often is whether a startup or corporate job is better for your career in the long run. Ask yourself: A startup may provide more flexible hours now, but will it give you the ability to move up into a senior management position in the future? A corporate job may be the perfect place to get structured on-the-job training, but will it give you the creative thinking skills you need to open your own business in a few years?\n\nThe following are the sides of the coin of working in a corporation with a 9-5 job vs working in a startup.\n\u25cf\tMultinational companies are more structured workplaces with large teams, multiple hierarchies, better pay and secure in terms of job security while startups are still growing, unstructured /semi-structured, competitive and challenging and offer an average pay scale.\n\n\u25cf\tStartups are basically a place of passionate people. People who want to do something different than compared to others prefer startups in which some end up as an experiment or become the top MNC. An MNC is established, have a larger number of clients with fewer losses, well-developed structure and with more benefits. In terms of better performance and personal growth, startups overtake MNCs.\n\n\u25cf\tMNCs are already established. So they hire people who will handle the clients and deal with the chaos; while in startups, the work environment is quite different. Every single assignment is a big task for employers.\n\n\u25cf\tWorking hard, extending the working hours and right delivery according to the client requirement matters more than anything else in a startup. Every employer should be cross-functional where his major activity is to deal with the client by showing the performance.\n\n\u25cf\tStartups push careers to the next level and initiate a super-fast growth in their career. Working in a startup company teaches you a lot of things. You become a problem solver, develop your capability, makes you more productive, tend to be a risk-taker to deliver the best output and become successful in your life by taking you to a better position. Whereas in MNCs, the productivity is comparatively less, as the work is assigned by others and initiation towards the work is quite low.\n\n\u25cf\tIn the corporate scenario, more often than not, employees prefer completing the task more than solving the problem. The most important drawback in an MNC is its internal growth or career growth is very low. Unless and until you are exceptionally talented, you won\u2019t achieve a better position or growth in the organization.\n\n\u25cf\tThe level of security in the job is relatively higher than startup\u2019s but the transparency is less in MNC. In MNC, CEO is a person who takes the major decisions of the company. On the basis of a few reports and scales, CEO tends to make decisions for the company. In a startup, the founder or the CEO will also work along with the employees so the transparency of decisions will be high.\n\n\u25cf\tIn simple words, working in the corporate means working hard in a recognized company where you can\u2019t find your personal recognition and it takes years to get a better position but is financially secure and professionally stable. Working in startups is beneficial to the career. Initially, it might give a lesser pay scale, but later on, it has high value and help you to develop you professionally.\n","Having your startup is definitely a great way to move ahead, however, it can also be one of the most difficult affairs to have. \n\n\u201cThe critical ingredient is getting off your butt and doing something. It\u2019s as simple as that. A lot of people have ideas, but there are few who decide to do something about them now. Not tomorrow. Not next week. But today. The true entrepreneur is a doer, not a dreamer.\u201d\n\u2013Nolan Bushnell, entrepreneur.\nYou need to introspect yourself and become sure if you are truly an entrepreneur. You may be an artist with entrepreneurial tendencies. You may be sale's man without the ability to innovate. Also, you may be right for the 3rd position in a multinational company. \nYou need to have a mindset of working hard 24 x 7 for 365 days. You should be humble enough to listen to everyone's criticism and negative comments but also should have a sieve in your ears to let only some in.\n\n1)\tGenerate your idea- You already have an idea. Let\u2019s validate the idea by brainstorming it. Identify the if, but, what-if, best case, worst case etc. In short, any damn possibility at this stage. Spend some time to understand what others are doing and how your idea is one cool idea which will change the face of industry or make life easier for others. If the general feedback is positive with a couple of challenges identified, do a deeper level validation by asking potential customers or users of your product. Most people are willing to honestly answer questions/provide feedback if the questions are earnest and succinct.\n2)\tFind a technical co-founder if you are not a Techie yourself. If you are one, find a Mentor or Marketing/Sales co-founder. - Having a trusted co-founder with a complementary skill-set will speed up your startup by 10X versus doing it alone. Practice, sharpen and internalize the core value proposition and the problem that you are solving for your initial MVP or POC\n3)\tCreate a Minimum Viable Product (MVP) or a Proof of Concept (POC)- This can be a simple Facebook/Web Page or a Mobile App (for MVP) or physical geography or demography which meets your target audience criteria (for POC). Record all your important metrics e.g. baseline numbers, time to make the first sale/acquire user, costs and related strategies.\n4)\tCreate a detailed business plan-At this stage, you will glean how your great idea can become the greatest, or perhaps think it is not-so-great-an-idea after all.\n5)\tSeek out Accelerators and Incubators or Funding sources-The general requirements for funding are - a sound business or problem solution, with a committed team and an understanding of the path to profitability or growth. As a function of Accelerators and Funding, you will be able to find help for setting a legal business structure and compliances thereof.\nTypical best-fit source of funds for the stage of the company\na)\tIdea - Friends and Family, Angels\nb)\tSeed - Accelerators, Corporate innovation funds, Angels\nc)\tTraction - Angels, Corporate, Early VC\nd)\tScale, Growth - Venture Capital (VC), Rounds A, B, C etc\ne)\tExit - Private Equity, M&A, Public Listing\n\n","Over the past few years, a number of new education systems have emerged to be popular in India. With the increased number of education boards, it\u2019s quite natural for parents to get confused about the best choice for their kids. Here we have listed down the 5 major boards along with all the necessary information about them which will help you make a more informed decision about which board is the most suitable for you. \n\n1. Central Board of Secondary Education (CBSE)\nThe Central Board of Secondary Education (CBSE) is the most popular board in India, controlled and managed by Union Government of India. With around 19,316 CBSE affiliated schools in India, the board also has a global presence with nearly 141 affiliated schools across 21 countries. \nObjective: CBSE always works with a vision to provide stress-free education to its students by adopting innovative teaching methods infused with psychological and instructive principles.\nSyllabus: CBSE syllabus more or less focuses on preparing students for Engineering and Medical entrance examinations. All national entrance examinations are conducted as per the CBSE syllabus. The board emphasises on the use of NCERT Books which form the basis of all entrance examinations conducted in India.\nExaminations: The two major examinations conducted by CBSE are All India Secondary School Examination (AISSE) for Class 10 and All India Senior School Certificate Examination (AISSCE) for Class 12.\n2. Council for the Indian School Certificate Examination (CISCE-ICSE/ISC) \nThe Council for the Indian School Certificate Examinations (CISCE)  is a privately-held national level board of school education in India. \nObjective: The main objective of ICSE is to provide high-quality education to students through a practical approach. It encourages students to choose across diverse streams/subjects for Class 12 by putting equal emphasis on science, arts and language subjects, especially English.\nSyllabus: CISCE syllabus is more vast and comprehensive in comparison with that of CBSE. It has been structured in a way to impart practical knowledge and build analytical skills required for the overall development of a student.\nExaminations: The Council for the Indian School Certificate Examinations conducts three examinations, namely, the Indian Certificate of Secondary Education (ICSE \u2013Class X); The Indian School Certificate (ISC - ClassXII) and the Certificate in Vocational Education (CVE - Year 12). The C.V.E. course is intended to prepare candidates for specific vocations.\n\n3. International Baccalaureate (IB)\nInternational Baccalaureate is a no-profit educational organization that offers prime quality programmes for children aged between 3 and 19. The IB schools are considered prestigious, at the same time expensive.\nObjective: It focuses on Analytical skills, language, arts and humanities. The purpose of the IB is to produce global citizens\nSyllabus: It has an international curriculum where subjects are taught in an integrated way in order to avoid a fragmented approach. IB has a different approach with a few textbooks. Students are free to explore the world.\nExaminations: It has 3 sections, the PYP (Primary years program, KG to 5th standard), MYP (Middle years program, 6th-10th standard) and the DYP (Diploma years program, 11th-12th standard). It has no prescribed textbooks delivering a lot of freedom in learning.\n4. Cambridge Assessment International Education (Cambridge International)\nMany schools in India are now getting affiliated to Cambridge International. Cambridge International conducts the IGCSE and AS & A-Level exams. Cambridge International is part of the University of Cambridge. Cambridge curriculum starts from Primary, Lower Secondary and Upper Secondary to Advanced. This is called the Cambridge Pathway.  Cambridge Pathway gives students a clear path for educational success from age 5 to 19.\nObjective: Cambridge Assessment International Education prepares school students for life, helping them develop an informed curiosity and a lasting passion for learning.\nSyllabus: Cambridge International offers a choice of over 70 subjects at IGCSE level and over 55 subjects AS & A level, which makes it one of the most flexible education boards in India. Schools can shape the curriculum around how they want students to learn. A lot of emphases is put on the English language and students are encouraged to propel their creativity through a variety of writings. Then there is an additional focus on foreign language that is intended to help the children in the long run.,\nExaminations: IGCSE exams are conducted at the end of Cambridge Upper Secondary (14 to 16-year-olds), and AS & A Level is conducted at the end of Cambridge Advanced (16 to 19-year-olds). Schools may choose to hold the examinations in June, November or March. The March series is only conducted in India to benefit students who wish to apply to Indian universities for higher education.\n5. State Boards\nState boards are specific to each State and follow separate syllabus and grading methodology. Every state board has its own educational approach which causes a variance in the syllabus from one state to another state in India.\nObjective: It focuses on state-level topics and content of local relevance which helps students in preparing for state-level engineering and medical entrance tests. .\nSyllabus: The syllabus is usually limited when compared to other boards. Regional languages and culture have a prominent place in the syllabus. Some state boards have ordered all their schools to follow NCERT books only which are important for students to prepare for pan India examinations.\nExaminations: Exams are conducted in each class. In Class X, the students appear for Secondary School Certificate (SSC) and the Class XII students appear for the Higher Secondary School Certificate (HSC) exams. \n"]],t.X,t.TN)}()
